import React from 'react'
import { Col, Row, Container } from "react-bootstrap";
import Navbar from "../component/navbar/navbar";
import './detailpage.css'
import alphabet from "../component/icons/alphabet.png";
import number from "../component/icons/number.png";
import color from "../component/icons/color.png";
import { NavLink } from "../elements/navbarElement"
import Box from '@mui/material/Box';
import Rating from '@mui/material/Rating';
import StarIcon from '@mui/icons-material/Star';
import headercourse from "../component/icons/abc.jpg"
import ReactPlayer from 'react-player'
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';

const labels = {
  0.5: '0.5',
  1: '1.0',
  1.5: '1.5',
  2: '2.0',
  2.5: '2.5',
  3: '3.0',
  3.5: '3.5',
  4: '4.0',
  4.5: '4.5',
  5: '5.0',
};



const Detailpage = () => {
    const [value, setValue] = React.useState('one');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

    return (

        <>
        <Navbar />
        <Container>
        <div style={{height:"180px"}}></div>
        <h1 className="headtext1">A B C</h1>
        <Box
      sx={{
        // justifyContent:'center',
        display: 'flex',
        alignItems: 'center',
      }}
    >
      <Rating
        name="text-feedback"
        value={value}
        readOnly
        precision={0.5}
        emptyIcon={<StarIcon style={{ opacity: 0.55 }} fontSize="inherit" />}
      />
      <Box sx={{ ml: 2 }}>{labels[value]} (2 Rating)</Box>
    </Box>
    <div style={{height:"40px"}}></div>
    <Row>
        <Col md={9}>
    <div className='player-wrapper'>
        <ReactPlayer
          className='react-player'
          url='https://www.youtube.com/watch?v=ysz5S6PUM-U'
          width='100%'
          height='100%'
        />

      </div>

      <Box sx={{ width: '500%' }}>
      <Tabs
        value={value}
        onChange={handleChange}
        textColor="secondary"
        indicatorColor="secondary"
        aria-label="secondary tabs example"
      >
        <Tab value="one" label="Overview" />
        <Tab value="two" label="Curriculum" />
        <Tab value="three" label="Teacher" />
        <Tab value="three" label="Rating & Review" />
      </Tabs>
    </Box>
      </Col>
      <Col md={3}>
          tes</Col> 
          </Row>  







           </Container>

    {/* <img src={headercourse} style={{width:"100%", height: "undefined"}}></img> */}
    </>



    )
}

export default Detailpage
